import{_ as a,c as i,o as t,ag as r}from"./chunks/framework.BgId8OS5.js";const g=JSON.parse('{"title":"深拷贝的实现","description":"","frontmatter":{},"headers":[],"relativePath":"前端/JavaScript/深拷贝的实现.md","filePath":"前端/JavaScript/深拷贝的实现.md"}'),n={name:"前端/JavaScript/深拷贝的实现.md"};function s(o,e,l,p,c,d){return t(),i("div",null,e[0]||(e[0]=[r(`<h1 id="深拷贝的实现" tabindex="-1">深拷贝的实现 <a class="header-anchor" href="#深拷贝的实现" aria-label="Permalink to &quot;深拷贝的实现&quot;">​</a></h1><h2 id="一、什么是深拷贝-深拷贝和浅拷贝有什么区别" tabindex="-1">一、什么是深拷贝？深拷贝和浅拷贝有什么区别？ <a class="header-anchor" href="#一、什么是深拷贝-深拷贝和浅拷贝有什么区别" aria-label="Permalink to &quot;一、什么是深拷贝？深拷贝和浅拷贝有什么区别？&quot;">​</a></h2><p>浅拷贝是指只复制第一层对象，但是当对象的属性是引用类型时，实质复制的是其引用，当引用指向的值改变时也会跟着变化。</p><p>深拷贝复制变量值，对于非基本类型的变量，则递归至基本类型变量后，再复制。深拷贝后的对象与原来的对象是完全隔离的，互不影响，对一个对象的修改并不会影响另一个对象。</p><h2 id="二、js-的变量存储类型" tabindex="-1">二、JS 的变量存储类型 <a class="header-anchor" href="#二、js-的变量存储类型" aria-label="Permalink to &quot;二、JS 的变量存储类型&quot;">​</a></h2><p>变量存储类型分两类</p><ol><li>基本类型：直接存储在<strong>栈</strong>中的数据。（<strong>字符串、布尔值、数字、undefined、null</strong>）</li><li>引用类型：将该对象引用地址存储在<strong>栈</strong>中，然后对象里面的数据存放在<strong>堆</strong>中。（<strong>数组、对象、Date、RegExp、函数</strong>、特殊的基本包装类型以及单体内置对象）</li></ol><p>特殊的基本包装类型(String、Number、Boolean)以及单体内置对象(Global、Math)</p><h3 id="_1-基本类型的变量是存放在栈区的-栈区指内存里的栈内存" tabindex="-1">1. 基本类型的变量是存放在栈区的（栈区指内存里的栈内存） <a class="header-anchor" href="#_1-基本类型的变量是存放在栈区的-栈区指内存里的栈内存" aria-label="Permalink to &quot;1. 基本类型的变量是存放在栈区的（栈区指内存里的栈内存）&quot;">​</a></h3><p>假如有以下几个基本类型的变量：</p><div class="language-js vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> name </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;jozo&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">;</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> city </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> &#39;guangzhou&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">;</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> age </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> 22</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">;</span></span></code></pre></div><p>那么它的存储结构如下图： <img src="https://camo.githubusercontent.com/d219f1aba36bb8474e216158506f6de9ec00926c27671334d26accd8f72eca81/68747470733a2f2f696d672d626c6f672e6373646e696d672e636e2f32303230303930393138353130333737392e706e67237069635f63656e746572" alt="在这里插入图片描述" loading="lazy"></p><p>栈区包括了 变量的标识符和变量的值。</p><h3 id="_2-引用类型的变量将对象引用地址存储在栈中-对象里面的数据存放在堆中" tabindex="-1">2. 引用类型的变量将对象引用地址存储在栈中，对象里面的数据存放在堆中 <a class="header-anchor" href="#_2-引用类型的变量将对象引用地址存储在栈中-对象里面的数据存放在堆中" aria-label="Permalink to &quot;2. 引用类型的变量将对象引用地址存储在栈中，对象里面的数据存放在堆中&quot;">​</a></h3><p>JavaScript 和其他语言不同，其不允许直接访问内存中的位置，也就是说不能直接操作对象的内存空间，那我们操作啥呢？ 实际上，是操作对象的引用，所以引用类型的值是按引用访问的。</p><p>准确地说，引用类型的存储需要内存的栈区和堆区（堆区是指内存里的堆内存）共同完成，栈区内存保存变量标识符和指向堆内存中该对象的指针，也可以说是该对象在堆内存的地址。</p><p>假如有以下几个对象：</p><div class="language-js vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> person1 </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> {name:</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;jozo&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">};</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> person2 </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> {name:</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;xiaom&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">};</span></span>
<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> person3 </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> {name:</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;xiaoq&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">};</span></span></code></pre></div><p>则这三个对象的在内存中保存的情况如下图：</p><p><img src="https://camo.githubusercontent.com/d2e3551d66e652dd69259f6594c3749d1876d964338e6a669f80c76aa38e4f10/68747470733a2f2f696d672d626c6f672e6373646e696d672e636e2f32303230303930393138353731343136382e706e67237069635f63656e746572" alt="在这里插入图片描述" loading="lazy"></p><h3 id="_3-简单赋值" tabindex="-1">3. 简单赋值 <a class="header-anchor" href="#_3-简单赋值" aria-label="Permalink to &quot;3. 简单赋值&quot;">​</a></h3><p>在从一个变量向另一个变量赋值基本类型时，会在该变量上创建一个新值，然后再把该值复制到为新变量分配的位置上：</p><p>var a = 10; var b = a;</p><p>a ++ ; console.log(a); // 11 console.log(b); // 10 此时，a中保存的值为 10 ，当使用 a 来初始化 b 时，b 中保存的值也为10，但b中的10与a中的是完全独立的，该值只是a中的值的一个副本，此后，这两个变量可以参加任何操作而相互不受影响。</p><p><img src="https://camo.githubusercontent.com/821260cbf1a851ee09408c2159d1fe81d2910077af0f424047a5cbd2afc50dd2/68747470733a2f2f696d672d626c6f672e6373646e696d672e636e2f32303230303930393139313633343737362e706e67237069635f63656e746572" alt="在这里插入图片描述" loading="lazy"></p><p><strong>也就是说基本类型在赋值操作后，两个变量是相互不受影响的。</strong></p><h3 id="_4-对象引用" tabindex="-1">4. 对象引用 <a class="header-anchor" href="#_4-对象引用" aria-label="Permalink to &quot;4. 对象引用&quot;">​</a></h3><p>当从一个变量向另一个变量赋值引用类型的值时，同样也会将存储在变量中的对象的值复制一份放到为新变量分配的空间中。前面讲引用类型的时候提到，保存在变量中的是对象在堆内存中的地址，所以，与简单赋值不同，这个值的副本实际上是一个指针，而这个指针指向存储在堆内存的一个对象。那么赋值操作后，两个变量都保存了同一个对象地址，则这两个变量指向了同一个对象。因此，改变其中任何一个变量，都会相互影响：</p><p>var a = {}; // a保存了一个空对象的实例 var b = a; // a和b都指向了这个空对象</p><p>a.name = &#39;jozo&#39;; console.log(a.name); // &#39;jozo&#39; console.log(b.name); // &#39;jozo&#39;</p><p>b.age = 22; console.log(b.age);// 22 console.log(a.age);// 22</p><p>console.log(a == b);// true 它们的关系如下图：</p><p><img src="https://camo.githubusercontent." alt="在这里插入图片描述" loading="lazy"></p><p><strong>因此，引用类型的赋值其实是对象保存在栈区地址指针的赋值，因此两个变量指向同一个对象，任何的操作都会相互影响。</strong></p><h2 id="三、深拷贝和浅拷贝" tabindex="-1">三、深拷贝和浅拷贝 <a class="header-anchor" href="#三、深拷贝和浅拷贝" aria-label="Permalink to &quot;三、深拷贝和浅拷贝&quot;">​</a></h2><p>最后再来看深拷贝和浅拷贝还有赋值的区别，这样就好理解多了</p><p><strong>浅拷贝</strong>：也就是拷贝A对象里面的数据，但是不拷贝A对象里面的子对象</p><p><strong>深拷贝</strong>：会克隆出一个对象，数据相同，但是引用地址不同（就是拷贝A对象里面的数据，而且拷贝它里面的子对象）</p><p><strong>赋值</strong>：简单赋值和对象引用，对象引用获得该对象的引用地址</p><h2 id="四、json-parse-json-stringify" tabindex="-1">四、JSON.parse(JSON.stringify()) <a class="header-anchor" href="#四、json-parse-json-stringify" aria-label="Permalink to &quot;四、JSON.parse(JSON.stringify())&quot;">​</a></h2><p>在不使用第三方库的情况下，想要深拷贝一个对象，一般来讲最简单的用的最多的就是 <code>JSON.parse(JSON.stringify(obj))</code>，其过程说白了就是利用 <code>JSON.stringify</code> 将 JS 对象序列化（JSON字符串），再使用 <code>JSON.parse</code> 来反序列化(还原) JS 对象。</p><p>JSON.parse(JSON.stringify(obj)); 这种写法非常简单，而且可以应对大部分的应用场景，但注意 JSON 只能用来序列化对象、数组、数值、字符串、布尔值和 <code>null</code>，依靠 JSON 深拷贝时存在很大缺陷，原因在于 <code>JSON.stringify()</code> 在序列化时会有以下问题：</p><p>1、时间对象序列化后会变成字符串；</p><p>const target = { name: &#39;Jack&#39;, date: [new Date(1536627600000), new Date(1540047600000)] }; JSON.parse(JSON.stringify(target)); <img src="https://user-images.githubusercontent.com/93993961/204478796-247f5581-845a-490a-a9f7-6c5fa7cc54b8.png" alt="image" loading="lazy"></p><p>Date 日期调用了 toJSON() 将其转换为了 string 字符串（同 Date.toISOString()），因此会被当做字符串处理。</p><p>JSON.stringify(new Date(1536627600000)); // &#39;&quot;2018-09-11T01:00:00.000Z&quot;&#39; 2、RegExp、Error 对象序列化后将只得到空对象；</p><p>const target = { re: new RegExp(&quot;\\w+&quot;), err: new Error(&#39;&quot;x&quot; is not defined&#39;) }; JSON.stringify(target); // &#39;{&quot;re&quot;:{},&quot;err&quot;:{}}&#39; <img src="https://user-images.githubusercontent.com/93993961/204478872-676802bc-df95-401f-b872-0005cfd47af7.png" alt="image" loading="lazy"></p><p>3、任意的函数、<code>undefined</code> 以及 symbol 值，在序列化过程中会被忽略；</p><p>const target = { func: function () { console.log(1) }, val: undefined, sym: Symbol(&#39;foo&#39;) }; JSON.stringify(target); // &#39;{}&#39; <img src="https://user-images.githubusercontent.com/93993961/204478927-b836fbed-e3e5-4415-a737-d670a432e5fc.png" alt="image" loading="lazy"></p><p>4、NaN 和 Infinity 格式的数值都会被当做 null；</p><ul><li><code>1.7976931348623157E+10308</code> 是浮点数的最大上限 显示为 Infinity</li><li><code>-1.7976931348623157E+10308</code> 是浮点数的最小下限 显示为 -Infinity</li></ul><p><img src="https://user-images.githubusercontent.com/93993961/204478982-30468b99-5aab-4f1f-a1e2-edec609ba7f9.png" alt="image" loading="lazy"></p><p>const target = { nan: NaN, infinityMax: 1.7976931348623157E+10308, infinityMin: -1.7976931348623157E+10308, }; JSON.stringify(target); // &#39;{&quot;nan&quot;:null,&quot;infinityMax&quot;:null,&quot;infinityMin&quot;:null}&#39; <img src="https://user-images.githubusercontent.com/93993961/204479012-45e67678-35ff-4fcf-97a3-e654b59f5137.png" alt="image" loading="lazy"></p><p>5、对包含循环引用的对象（对象之间相互引用，形成无限循环）序列化，会抛出错误。</p><p>var circularReference = { otherData: 123 }; circularReference.myself = circularReference; JSON.stringify(circularReference); // TypeError: cyclic object value(Firefox) 或 Uncaught TypeError: Converting circular structure to JSON(Chrome and Opera) <img src="https://user-images.githubusercontent.com/93993961/204479048-6a4acd7b-76ea-462b-8bad-6cb1befbc0c3.png" alt="image" loading="lazy"></p><p>在 JSON 中出现循环引用时，JavaScript 会抛出 &quot;cyclic object value&quot; 的异常。<code>JSON.stringify()</code> 并不会尝试解决这个问题，因此导致运行失败。</p><ul><li>提示信息:</li><li>TypeError: cyclic object value (Firefox)</li><li>TypeError: Converting circular structure to JSON (Chrome and Opera)</li><li>TypeError: Circular reference in value argument not supported (Edge)</li></ul><h2 id="五、深拷贝" tabindex="-1">五、深拷贝 <a class="header-anchor" href="#五、深拷贝" aria-label="Permalink to &quot;五、深拷贝&quot;">​</a></h2><p>通过递归实现深拷贝：</p><p>function deepClone(obj) { // 递归拷贝 if (typeof obj !== &#39;object&#39; || obj === null) return obj; // 如果不是复杂数据类型 或者为null，直接返回 if (obj instanceof RegExp) return new RegExp(obj); if (obj instanceof Date) return new Date(obj); let cloneObj = Array.isArray(obj) ? [] : {}; for (let key in obj) { // 判断是否是对象自身的属性，筛掉对象原型链上继承的属性 if (obj.hasOwnProperty(key)) { // 如果 obj[key] 是复杂数据类型，递归 cloneObj[key] = deepClone(obj[key]); } } return cloneObj; } 我们应该拷贝要拷贝对象自身的属性，对象原型上的属性我们不应该拷贝，这里我们用到 <code>hasOwnProperty()</code> 方法来解决。</p><p><strong><code>hasOwnProperty()</code> 方法会返回一个布尔值，这个方法可以用来检测一个对象是否含有特定的自身属性；该方法会忽略掉那些从原型链上继承到的属性。</strong></p><h3 id="_1-循环引用" tabindex="-1">1. 循环引用 <a class="header-anchor" href="#_1-循环引用" aria-label="Permalink to &quot;1. 循环引用&quot;">​</a></h3><p>循环引用会使递归进入死循环导致栈内存溢出。</p><p>我们拷贝一下前面循环引用的例子：</p><p>var circularReference = { otherData: 123 }; circularReference.myself = circularReference; deepClone(circularReference); // Uncaught RangeError: Maximum call stack size exceeded 超出最大调用堆栈大小 解决循环引用问题，可以额外开辟一个存储空间，来存储当前对象和拷贝对象的对应关系，当需要拷贝当前对象时，先去存储空间中找，有没有拷贝过这个对象，如果有的话直接返回，如果没有的话继续拷贝，这样就巧妙化解的循环引用的问题。</p><p>这个存储空间，需要可以存储 <code>key-value</code> 形式的数据，且 <strong><code>key</code> 可以是一个引用类型</strong>，我们可以选择 <code>Map</code> 这种数据结构：</p><ul><li>检查 <code>map</code> 中有无克隆过的对象</li><li>有 - 直接返回</li><li>没有 - 将当前对象作为 <code>key</code>，克隆对象作为 <code>value</code> 进行存储</li><li>继续克隆</li></ul><p>function deepClone(obj, map = new Map()) { // 递归拷贝 if (typeof obj !== &#39;object&#39; || obj === null) return obj; // 如果不是复杂数据类型 或者为null，直接返回 if (obj instanceof RegExp) return new RegExp(obj); if (obj instanceof Date) return new Date(obj); if (map.has(obj)) return map.get(obj); let cloneObj = Array.isArray(obj) ? [] : {}; map.set(obj, cloneObj); for (let key in obj) { // 判断是否是对象自身的属性，筛掉对象原型链上继承的属性 if (obj.hasOwnProperty(key)) { // 如果 obj[key] 是复杂数据类型，递归 cloneObj[key] = deepClone(obj[key], map); } } return cloneObj; } 再次执行前面的用例可以发现没有报错，循环引用的问题解决了。</p><h3 id="_2-使用-weakmap-优化" tabindex="-1">2. 使用 WeakMap 优化 <a class="header-anchor" href="#_2-使用-weakmap-优化" aria-label="Permalink to &quot;2. 使用 WeakMap 优化&quot;">​</a></h3><p>下面我们用 <code>WeakMap</code> 替代 <code>Map</code> 来优化深拷贝的实现。</p><p>如下：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>function deepClone(obj, map = new WeakMap()) {</span></span>
<span class="line"><span>    // ...</span></span>
<span class="line"><span>};</span></span></code></pre></div><p>为什么要这样做呢？先来看看 <code>WeakMap</code> 的作用：</p><p>WeakMap 对象是一组键/值对的集合，其中的键是弱引用的。其键必须是对象，而值可以是任意的。</p><p>什么是弱引用呢？</p><p>在计算机程序设计中，弱引用与强引用相对，是指不能确保其引用的对象不会被垃圾回收器回收的引用。 一个对象若只被弱引用所引用，则被认为是不可访问（或弱可访问）的，并因此可能在任何时刻被回收。</p><p>我们默认创建一个对象：<code>const obj = {}</code>，就默认创建了一个强引用的对象，我们只有手动将 <code>obj = null</code>，它才会被垃圾回收机制进行回收，如果是弱引用对象，垃圾回收机制会自动帮我们回收。</p><p>举个例子：</p><p>如果我们使用 <code>Map</code> 的话，那么对象间是存在强引用关系的：</p><p>let obj = { name : &#39;Jack&#39;} const target = new Map(); target.set(obj,&#39;person&#39;); obj = null; 虽然我们手动将 <code>obj</code>，进行释放，然是 <code>target</code> 依然对 <code>obj</code> 存在强引用关系，所以这部分内存依然无法被释放。</p><p>再来看 <code>WeakMap</code>：</p><p>let obj = { name : &#39;Jack&#39;} const target = new WeakMap(); target.set(obj,&#39;person&#39;); obj = null; 如果是 <code>WeakMap</code> 的话，<code>target</code> 和 <code>obj</code> 存在的就是弱引用关系，当下一次垃圾回收机制执行时，这块内存就会被释放掉。</p><p>设想一下，如果我们要拷贝的对象非常庞大时，使用 <code>Map</code> 会对内存造成非常大的额外消耗，而且我们需要手动清除 <code>Map</code> 的属性才能释放这块内存，而 <code>WeakMap</code> 会帮我们巧妙化解这个问题。</p><p>我也经常在某些代码中看到有人使用 <code>WeakMap</code> 来解决循环引用问题，但是解释都是模棱两可的，当你不太了解 <code>WeakMap</code> 的真正作用时。我建议你也不要在面试中写这样的代码，结果只能是给自己挖坑，即使是准备面试，你写的每一行代码也都是需要经过深思熟虑并且非常明白的。</p><p>能考虑到循环引用的问题，你已经向面试官展示了你考虑问题的全面性，如果还能用 <code>WeakMap</code> 解决问题，并很明确的向面试官解释这样做的目的，那么你的代码在面试官眼里应该算是合格了。</p><ul><li>循环引用部分内容出自 <code>ConardLi大佬</code> <a href="https://link.juejin.cn/?target=https%3A%2F%2Fsegmentfault.com%2Fa%2F1190000020255831" target="_blank" rel="noreferrer">如何写出一个惊艳面试官的深拷贝?</a>。</li></ul><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-label="Permalink to &quot;参考&quot;">​</a></h2><ul><li><a href="https://juejin.cn/post/6844903929705136141" target="_blank" rel="noreferrer">如何写出一个惊艳面试官的深拷贝? </a></li><li><a href="https://github.com/mqyqingfeng/Blog/issues/32" target="_blank" rel="noreferrer">JavaScript专题之深浅拷贝</a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Errors/Cyclic_object_value" target="_blank" rel="noreferrer">TypeError: cyclic object value</a></li><li><a href="https://juejin.cn/post/6844904197595332622" target="_blank" rel="noreferrer">浅拷贝与深拷贝</a></li><li><a href="https://zhuanlan.zhihu.com/p/410729303" target="_blank" rel="noreferrer">探秘 JavaScript 世界的神秘数字 1.7976931348623157e+308</a></li><li><a href="https://segmentfault.com/a/1190000016672263" target="_blank" rel="noreferrer">深拷贝的终极探索（99%的人都不知道）</a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/Map" target="_blank" rel="noreferrer">Map</a></li><li><a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/JSON" target="_blank" rel="noreferrer">JSON</a></li><li><a href="https://www.cnblogs.com/sweet-ice/p/10583192.html" target="_blank" rel="noreferrer">JSON.parse(JSON.stringify()) 实现对对象的深拷贝</a></li><li><a href="https://blog.csdn.net/weixin_44194217/article/details/111192652" target="_blank" rel="noreferrer">JSON.parse(JSON.stringify(obj))实现深拷贝的弊端以及解决方法</a></li></ul><p><a href="https://github.com/yuanyuanbyte/Blog" target="_blank" rel="noreferrer">查看全部文章</a></p><h3 id="博文系列目录" tabindex="-1">博文系列目录 <a class="header-anchor" href="#博文系列目录" aria-label="Permalink to &quot;博文系列目录&quot;">​</a></h3><ul><li>JavaScript 深入系列</li><li>JavaScript 专题系列</li><li>JavaScript 基础系列</li><li>网络系列</li><li>浏览器系列</li><li>Webpack 系列</li><li>Vue 系列</li><li>性能优化与网络安全系列</li><li>HTML 应知应会系列</li><li>CSS 应知应会系列</li></ul><h3 id="交流" tabindex="-1">交流 <a class="header-anchor" href="#交流" aria-label="Permalink to &quot;交流&quot;">​</a></h3><p>各系列文章汇总：<a href="https://github.com/yuanyuanbyte/Blog" target="_blank" rel="noreferrer">https://github.com/yuanyuanbyte/Blog</a></p><p>我是圆圆，一名深耕于前端开发的攻城狮。</p><p><img src="https://user-images.githubusercontent.com/93993961/146809963-39c528ae-4e8f-4d5e-a1da-515385e169c3.png" alt="weixin" loading="lazy"></p>`,95)]))}const u=a(n,[["render",s]]);export{g as __pageData,u as default};
